import React from 'react';
import Navbar from './Navbar.js'
import Banner from './banner.jpeg'


const Home = () => {
    return ( 
        <div className="home">
          <Navbar />
          <div className="img-text-wrapper">
    <div className="logo-wrapper">
    <img src={Banner} alt="Banner" style={{
              flex: 1,
              width: '119%',
              height: '100%',
              alignItems: "stretch",
              resizeMode: 'contain',
            }}/>
    </div>
        </div>
        </div>
     );
}

export default Home;
